import React, { useState, useEffect } from 'react';
import { Routes, Route, Link, Navigate, useNavigate } from 'react-router-dom';
import Login from './components/Login';
import PatientDashboard from './components/PatientDashboard';
import PromotionSection from './components/PromotionSection';
import MapSection from './components/MapSection';
import ReviewSection from './components/ReviewSection';
import Register from './components/Register';
import ProtectedRoute from './components/ProtectedRoute'; // ตรวจสอบว่า import ถูกต้อง

function App() {
  const [user, setUser] = useState(null);
  const [loadingUser, setLoadingUser] = useState(true);
  const navigate = useNavigate();

  console.log('App rendered, current user:', user, 'loadingUser:', loadingUser);

  useEffect(() => {
    const savedUser = localStorage.getItem('user');
    console.log('Loading user from localStorage:', savedUser);
    if (savedUser && savedUser !== 'undefined' && savedUser !== 'null') {
      try {
        const parsedUser = JSON.parse(savedUser);
        console.log('Parsed user:', parsedUser);
        setUser(parsedUser);
      } catch (error) {
        console.error('Failed to parse saved user from localStorage:', error);
        localStorage.removeItem('user');
      }
    }
    setLoadingUser(false);
  }, []);

  const handleLogin = (userData) => {
    console.log('Handling login with userData:', userData);
    if (userData && userData.role) { // ตรวจสอบว่า userData มี role
      setUser(userData);
      localStorage.setItem('user', JSON.stringify(userData));
      // ใช้ setTimeout เพื่อให้แน่ใจว่า state อัปเดตก่อน redirect
      setTimeout(() => navigate('/patient-dashboard'), 100);
    } else {
      console.warn('Invalid userData, missing role:', userData);
    }
  };

  const handleLogout = () => {
    console.log('User logged out');
    setUser(null);
    localStorage.removeItem('user');
    navigate('/login');
  };

  // ใช้ useEffect เพื่อจัดการ redirect หลัง state อัปเดต
  useEffect(() => {
    if (user && user.role === 'patient' && window.location.pathname === '/login') {
      console.log('User logged in, navigating to /patient-dashboard');
      navigate('/patient-dashboard');
    }
  }, [user, navigate]);

  return (
    <div className="min-h-screen bg-gray-100">
      <header className="p-4 bg-blue-600 text-white flex justify-between items-center">
        <div>
          <Link to="/" className="mr-4 text-white hover:underline">Home</Link>
          {user && <Link to="/patient-dashboard" className="text-white hover:underline">Dashboard</Link>}
        </div>
        <div>
          {user ? (
            <button onClick={handleLogout} className="bg-red-500 p-2 rounded">Logout</button>
          ) : (
            <>
              <Link to="/login" className="bg-green-500 p-2 rounded mr-2">Login</Link>
              <Link to="/register" className="bg-blue-500 p-2 rounded">Sign Up</Link>
            </>
          )}
        </div>
      </header>
      <main className="p-4">
        <Routes>
          <Route
            path="/"
            element={
              <>
                <PromotionSection />
                <MapSection />
                <ReviewSection />
              </>
            }
          />
          <Route path="/login" element={<Login onLogin={handleLogin} />} />
          <Route path="/register" element={<Register />} />
          <Route
            path="/patient-dashboard"
            element={
              loadingUser
                ? <p>Loading...</p>
                : (
                  <ProtectedRoute user={user} role="patient">
                    <PatientDashboard user={user} />
                  </ProtectedRoute>
                )
            }
          />
        </Routes>
      </main>
    </div>
  );
}

export default App;
